import React,{useState} from 'react'
import {View,Button,Platform,Text} from 'react-native';
import DateTimePicker from '@react-native-community/datetimepicker';
  
export default function Teste1() {
  const[date,setDate] = useState('03/12/2022');
  const[mode,setMode] = useState('date');
  const[show,setShow] = useState(false);

  const onChange = (event,selectedDate) => {const currentDate =selectedDate || date;setShow(Platform.OS === 'ios');setDate(currentDate)};
  const showMode = (currentMode) => {setShow(true); setMode(currentMode);};
  const showDatepicker = () => {
    showMode('date');
  }
  return (
    <View>
        <View>
            <Button onPress = {showDatepicker} title = 'Show date picker!'/>
        
    </View>
        {show && ( 
            <DateTimePicker 
                testID = 'dateTimePicker' 
                value = {date}
                mode = {mode}
                is24Hour = {true}
                display = "default"
                onChange = {onChange}
            />
        )};
        </View>
  );
}
